import React from "react";
function HelloDiv() {
  return  <div>
            <h1>Hello! My name is Andrew.</h1>
            <ul>Favorite Smells:</ul>
            <li>gardenias</li>
            <li>mint</li>
            <li>fire</li>
          </div>;
}

export default HelloDiv;
